script: |
  super -f text -I q805.spq | sort > q805.out

inputs:
  - name: q805.spq
    data: |
      SELECT DISTINCT ( - cor1.col2 ) + ( - 26 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab2

outputs:
  - name: q805.out
    data: |
      -52
      -53
      -64
